import React from 'react';
import styles from '../styles/Visualizador.module.css';

const ColumnaIzquierda = ({ isCollapsed, handleCollapse }) => {
    const estiloLiNormal = {
        fontSize: '14px',
        height: '20px',
        marginBottom: '30px',
        textAlign: isCollapsed ? 'center' : 'left'
    };

    const estiloTituloLi = {
        fontSize: isCollapsed ? '14px' : '16px',
        height: '20px',
        marginBottom: '30px',
        marginLeft: isCollapsed ? '0' : '30px',
        fontWeight: 'bold',
        textAlign: 'center',
        alignItems: 'center'
    };

    const estiloImg = {
        alignItems: 'center',
        marginRight: '10px',
        marginTop: isCollapsed ? '25px' : '0',
        marginBottom: isCollapsed ? '5px' : '0'
    };

    return (
        <div className={`${styles.leftColumn} col-${isCollapsed ? '1' : '2'}`} style={{width: isCollapsed ? '100%' : '100%'}}>
            <div className="container-fluid" style={{padding: '0'}}>
                <div className="row">
                    <div className="col" style={{backgroundColor: 'white', display: 'flex', alignItems: 'center', justifyContent: 'flex-end'}}>
                        {!isCollapsed && (
                            <img src="images/logo.png" alt="Logo" style={{width: '55%', alignSelf: 'flex-start', marginTop: '10px'}} />
                        )}
                        <button onClick={handleCollapse} style={{background: 'none', border: 'none', marginRight: '30px', margin: '15px'}}>
                            {isCollapsed && (
                                <img src="images/isotipo.png" alt="MÃ¡s" style={{marginRight: '20px', width: '50%'}} />
                            )}
                            <img src="images/puntos.svg" alt="Imagen"/>
                        </button>
                    </div>
                </div>
                <div className="row">
                    <div className="col">
                        <ul style={{listStyleType: 'none', color: '#D4D3D3', fontSize: '14px', fontStyle: 'normal', fontWeight: 400, lineHeight: 'normal', letterSpacing: '-0.35px', marginTop: '10px', textAlign: 'left', paddingLeft: '0'}}>
                            <li style={estiloTituloLi}>Principal</li>
                            <li style={estiloLiNormal}>
                                <img src={isCollapsed ? "images/visualizador.svg" : "images/visualizador.svg"} alt="Visualizador" style={estiloImg} />
                                Visualizador
                            </li>
                            {/* ... otros elementos <li> ... */}
                        </ul>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default ColumnaIzquierda;
